INSERT INTO `cache_metatag` VALUES ('info:es','a:2:{s:6:\"groups\";a:1:{s:8:\"advanced\";a:2:{s:5:\"label\";s:8:\"Avanzado\";s:4:\"form\";a:1:{s:7:\"#weight\";i:100;}}}s:4:\"tags\";a:17:{s:5:\"title\";a:5:{s:5:\"label\";s:21:\"Título de la página\";s:11:\"description\";s:194:\"The text to display in the title bar of a visitor\'s web browser when they view this page. This meta tag may also be used as the title of the page when a visitor bookmarks or favorites this page.\";s:5:\"class\";s:18:\"DrupalTitleMetaTag\";s:6:\"weight\";i:1;s:4:\"name\";s:5:\"title\";}s:11:\"description\";a:6:{s:5:\"label\";s:12:\"Descripción\";s:11:\"description\";s:195:\"A brief and concise summary of the page\'s content, preferably 150 characters or less. The description meta tag may be used by search engines to display a snippet about the page in search results.\";s:5:\"class\";s:17:\"DrupalTextMetaTag\";s:6:\"weight\";i:2;s:4:\"form\";a:3:{s:5:\"#type\";s:8:\"textarea\";s:5:\"#rows\";i:2;s:8:\"#wysiwyg\";b:0;}s:4:\"name\";s:11:\"description\";}s:8:\"abstract\";a:6:{s:5:\"label\";s:7:\"Resumen\";s:11:\"description\";s:161:\"A brief and concise summary of the page\'s content, preferably 150 characters or less. The abstract meta tag may be used by search engines for archiving purposes.\";s:5:\"class\";s:17:\"DrupalTextMetaTag\";s:6:\"weight\";i:3;s:4:\"form\";a:3:{s:5:\"#type\";s:8:\"textarea\";s:5:\"#rows\";i:2;s:8:\"#wysiwyg\";b:0;}s:4:\"name\";s:8:\"abstract\";}s:8:\"keywords\";a:5:{s:5:\"label\";s:14:\"Palabras clave\";s:11:\"description\";s:114:\"A comma-separated list of keywords about the page. This meta tag is <em>not</em> supported by most search engines.\";s:5:\"class\";s:17:\"DrupalTextMetaTag\";s:6:\"weight\";i:4;s:4:\"name\";s:8:\"keywords\";}s:6:\"robots\";a:7:{s:5:\"label\";s:6:\"Robots\";s:11:\"description\";s:90:\"Provides search engines with specific directions for what to do when this page is indexed.\";s:5:\"class\";s:17:\"DrupalListMetaTag\";s:5:\"group\";s:8:\"advanced\";s:6:\"weight\";i:5;s:4:\"form\";a:1:{s:8:\"#options\";a:10:{s:5:\"index\";s:50:\"Allow search engines to index this page (assumed).\";s:6:\"follow\";s:60:\"Allow search engines to follow links on this page (assumed).\";s:7:\"noindex\";s:48:\"Prevents search engines from indexing this page.\";s:8:\"nofollow\";s:58:\"Prevents search engines from following links on this page.\";s:9:\"noarchive\";s:69:\"Prevents cached copies of this page from appearing in search results.\";s:9:\"nosnippet\";s:82:\"Prevents descriptions from appearing in search results, and prevents page caching.\";s:5:\"noodp\";s:114:\"Blocks the <a href=\"http://www.dmoz.org/\">Open Directory Project</a> description from appearing in search results.\";s:6:\"noydir\";s:99:\"Prevents Yahoo! from listing this page in the <a href=\"http://dir.yahoo.com/\">Yahoo! Directory</a>.\";s:12:\"noimageindex\";s:57:\"Prevent search engines from indexing images on this page.\";s:11:\"notranslate\";s:80:\"Prevent search engines from offering to translation this page in search results.\";}}s:4:\"name\";s:6:\"robots\";}s:13:\"news_keywords\";a:6:{s:5:\"label\";s:20:\"Google News Keywords\";s:11:\"description\";s:196:\"A comma-separated list of keywords about the page. This meta tag is used as an indicator in <a href=\"http://support.google.com/news/publisher/bin/answer.py?hl=en&amp;answer=68297\">Google News</a>.\";s:5:\"class\";s:17:\"DrupalTextMetaTag\";s:5:\"group\";s:8:\"advanced\";s:6:\"weight\";i:6;s:4:\"name\";s:13:\"news_keywords\";}s:8:\"standout\";a:6:{s:5:\"label\";s:15:\"Google Standout\";s:11:\"description\";s:282:\"Highlight standout journalism on the web, especially for breaking news; used as an indicator in <a href=\"https://support.google.com/news/publisher/answer/191283?hl=en&amp;ref_topic=2484650\">Google News</a>. Warning: Don\'t abuse it, to be used a maximum of 7 times per calendar week!\";s:5:\"class\";s:17:\"DrupalTextMetaTag\";s:5:\"group\";s:8:\"advanced\";s:6:\"weight\";i:7;s:4:\"name\";s:8:\"standout\";}s:9:\"generator\";a:8:{s:5:\"label\";s:9:\"Generador\";s:11:\"description\";s:97:\"Describes the name and version number of the software or publishing tool used to create the page.\";s:5:\"class\";s:17:\"DrupalTextMetaTag\";s:6:\"header\";s:11:\"X-Generator\";s:7:\"context\";a:1:{i:0;s:6:\"global\";}s:5:\"group\";s:8:\"advanced\";s:6:\"weight\";i:8;s:4:\"name\";s:9:\"generator\";}s:6:\"rights\";a:7:{s:5:\"label\";s:6:\"Rights\";s:11:\"description\";s:145:\"Details about intellectual property, such as copyright or trademarks; does not automatically protect the site\'s content or intellectual property.\";s:5:\"class\";s:17:\"DrupalTextMetaTag\";s:5:\"group\";s:8:\"advanced\";s:6:\"weight\";i:9;s:8:\"replaces\";a:1:{i:0;s:9:\"copyright\";}s:4:\"name\";s:6:\"rights\";}s:9:\"image_src\";a:7:{s:5:\"label\";s:6:\"Imagen\";s:11:\"description\";s:97:\"An image associated with this page, for use as a thumbnail in social networks and other services.\";s:5:\"class\";s:17:\"DrupalLinkMetaTag\";s:5:\"group\";s:8:\"advanced\";s:6:\"weight\";i:10;s:14:\"devel_generate\";a:1:{s:4:\"type\";s:5:\"image\";}s:4:\"name\";s:9:\"image_src\";}s:9:\"canonical\";a:7:{s:5:\"label\";s:13:\"URL canónica\";s:11:\"description\";s:86:\"Preferred page location or URL to help eliminate duplicate content for search engines.\";s:5:\"class\";s:17:\"DrupalLinkMetaTag\";s:5:\"group\";s:8:\"advanced\";s:6:\"weight\";i:11;s:14:\"devel_generate\";a:1:{s:4:\"type\";s:9:\"canonical\";}s:4:\"name\";s:9:\"canonical\";}s:9:\"shortlink\";a:7:{s:5:\"label\";s:13:\"Shortlink URL\";s:11:\"description\";s:55:\"A brief URL, often created by a URL shortening service.\";s:5:\"class\";s:17:\"DrupalLinkMetaTag\";s:5:\"group\";s:8:\"advanced\";s:6:\"weight\";i:12;s:14:\"devel_generate\";a:1:{s:4:\"type\";s:9:\"shortlink\";}s:4:\"name\";s:9:\"shortlink\";}s:9:\"publisher\";a:7:{s:5:\"label\";s:13:\"Publisher URL\";s:11:\"description\";s:0:\"\";s:5:\"class\";s:17:\"DrupalLinkMetaTag\";s:5:\"group\";s:8:\"advanced\";s:6:\"weight\";i:13;s:14:\"devel_generate\";a:1:{s:4:\"type\";s:3:\"url\";}s:4:\"name\";s:9:\"publisher\";}s:6:\"author\";a:7:{s:5:\"label\";s:13:\"URL del autor\";s:11:\"description\";s:194:\"Used by some search engines to confirm authorship of the content on a page. Should be either the full URL for the author\'s Google+ profile page or a local page with information about the author.\";s:5:\"class\";s:17:\"DrupalLinkMetaTag\";s:5:\"group\";s:8:\"advanced\";s:6:\"weight\";i:14;s:14:\"devel_generate\";a:1:{s:4:\"type\";s:3:\"url\";}s:4:\"name\";s:6:\"author\";}s:15:\"original-source\";a:7:{s:5:\"label\";s:15:\"Original Source\";s:11:\"description\";s:200:\"Used to indicate the URL that broke the story, and can link to either an internal URL or an external source. If the full URL is not known it is acceptable to use a partial URL or just the domain name.\";s:5:\"class\";s:17:\"DrupalTextMetaTag\";s:5:\"group\";s:8:\"advanced\";s:6:\"weight\";i:15;s:14:\"devel_generate\";a:1:{s:4:\"type\";s:3:\"url\";}s:4:\"name\";s:15:\"original-source\";}s:13:\"revisit-after\";a:7:{s:5:\"label\";s:13:\"Revisit After\";s:11:\"description\";s:188:\"Tell search engines when to index the page again. Very few search engines support this tag, it is more useful to use an <a href=\"http://drupal.org/project/xmlsitemap\">XML Sitemap</a> file.\";s:5:\"class\";s:25:\"DrupalDateIntervalMetaTag\";s:5:\"group\";s:8:\"advanced\";s:6:\"weight\";i:16;s:14:\"devel_generate\";a:1:{s:4:\"type\";s:4:\"date\";}s:4:\"name\";s:13:\"revisit-after\";}s:16:\"content-language\";a:7:{s:5:\"label\";s:20:\"Idioma del contenido\";s:11:\"description\";s:75:\"A deprecated meta tag for defining this page\'s two-letter language code(s).\";s:5:\"class\";s:17:\"DrupalTextMetaTag\";s:5:\"group\";s:8:\"advanced\";s:6:\"weight\";i:17;s:7:\"element\";a:1:{s:6:\"#theme\";s:18:\"metatag_http_equiv\";}s:4:\"name\";s:16:\"content-language\";}}}',0,1415666645,1);
