arán los enlaces permitidos en ese momento; por ejemplo: Si un usuario no es miembro de un rol con los permisos <em>Permisos de administración</em> (módulo user) y <em>Administrar usuarios</em> (módulo user), no se le mostrará el elemento del menú <em>Administración de usuario</em>.','es',0,0,0,0),(80,'Menú administrativo','es',0,0,0,0),(81,'Ajustar opciones del menú administrativo.','es',0,0,0,0),(82,'@count-anon / @count-auth','es',0,0,0,0),(83,'Provee un menú desplegable para la mayoría de las tareas administrativas y otros destinos comunes (para los usuarios con los permisos apropiados).','es',0,0,0,0),(84,'Lista de incidencias de @project','es',0,0,0,0),(85,'Vaciar todas las cachés','es',0,0,0,0),(86,'Módulos de desarrollos que se deben mantener activos','es',0,0,0,0),(87,'Bienvenido, <strong>@username</strong>','es',0,0,0,0),(88,'Mostrar atajos','es',0,0,0,0),(89,'Estilo de la barra de herramientas del menú administrativo','es',0,0,0,0),(90,'Una barra de herramientas.','es',0,0,0,0),(91,'Registro de Clase','es',0,0,0,0),(92,'Muestra siempre el menú de administración en la parte superior de la ventana del navegador (incluso al desplazarse en la página).','es',0,0,0,0),(93,'En algunos navegadores, esta opción puede ocasionar una página deformada, un cursor invisible, elementos no seleccionables en formularios u otros problemas.','es',0,0,0,0),(94,'Plegar grupos de módulos en la página <a href=\"!modules-url\">%modules</a>','es',0,0,0,0),(95,'Plegar grupos de módulos en la página <a href=\"@permissions-url\">%permissions</a> page','es',0,0,0,0),(96,'Mueve las pestañas en todas las páginas en el menú de administración. Sólo posible para temas que utilicen las clases CSS <code>tabs primary</code> y <code>tabs secondary</code>.','es',0,0,0,0),(97,'Los módulos seleccionados no se desactivará cuando se invoque el enlace %disable-developer-modules bajo el icono en el menú.','es',0,0,0,0),(98,'Accede al menú de administración','es',0,0,0,0),(99,'Mostrar el menú de admin